import React from 'react'
import infoArr from "../../infoArr"
const Booklist = () => {

    return (
        <div>
            {
                infoArr.filter((info, index) => (
                    <div key={index}>
                        <img src={info.imageUrl} alt={info.bookName} />
                        <h1>{info.bookName}</h1>
                    </div>
                ))
            }
        </div>
    );
}

export default Booklist
